[{"operationName":"fetchVideoComments","variables":{"id":"61dbb1bc3ec54519a401a90215d7a84b","password":""},"query":"query fetchVideoComments($id: ID!, $password: String) {
  video: getVideo(id: $id, password: $password) {
    __typename
    ... on RegularUserVideo {
      video_comments {
        ...CommentFragment
        __typename
      }
      __typename
    }
  }
}

fragment CommentFragment on PublicVideoComment {
  id
  content(withMentionMarkups: true)
  plainContent: content(withMentionMarkups: false)
  time_stamp
  user_name
  avatar {
    name
    thumb
    __typename
  }
  createdAt
  user_id
  anon_user_id
  children_comments {
    id
    content(withMentionMarkups: true)
    plainContent: content(withMentionMarkups: false)
    time_stamp
    user_name
    avatar {
      name
      thumb
      __typename
    }
    user_id
    anon_user_id
    createdAt
    comment_post_id
    __typename
  }
  __typename
}
"},{"operationName":"FetchVideoTranscript","variables":{"videoId":"61dbb1bc3ec54519a401a90215d7a84b"},"query":"query FetchVideoTranscript($videoId: ID!, $password: String) {
  fetchVideoTranscript(videoId: $videoId, password: $password) {
    ... on VideoTranscriptDetails {
      captions_source_url
      __typename
    }
    ... on GenericError {
      message
      __typename
    }
    __typename
  }
}
"},{"operationName":"FetchVideoTranscript","variables":{"videoId":"61dbb1bc3ec54519a401a90215d7a84b","password":""},"query":"query FetchVideoTranscript($videoId: ID!, $password: String) {
  fetchVideoTranscript(videoId: $videoId, password: $password) {
    ... on VideoTranscriptDetails {
      id
      video_id
      s3_id
      version
      transcript_url
      captions_url
      processing_service
      transcription_status
      processing_start_time
      processing_end_time
      createdAt
      updatedAt
      source_url
      captions_source_url
      filler_words
      filler_word_removal
      __typename
    }
    ... on GenericError {
      message
      __typename
    }
    __typename
  }
}
"}]
